Criswell Embroidery &amp; Design

831 Baskets of K-Lace

Baskets of pansies are only the beginning! From 1.5&quot; to 6&quot;, woven with ribbon in colors of your choosing, these baskets will star on holidays, at weddings, for home decor and more! 
Some of the same files will make borders as at left, or even whole placemats, garments or table toppers with the included corners. 

Lace pansies, too, in three sizes! On stems they can be arranged in bouquets; without stems they can be added to the baskets, to quilts or table linens as well as garments, and used as lace jewelry. Stitch them in two colors as shown in our basket arrangement, or white or a single color to be shaded with fabric dye, as shown at the top. Use them with or without added beads. 

There are sixty-four individual files that fit in 4-inch hoops. Dst and pes formats have extra combined files for a total of ninety-one.
